window.bookSummaryJSON = "<p>From number one <i>New York Times</i> best-selling author Marissa Meyer comes a high-stakes world of adventure, passion, danger, and betrayal. This new audiobook will pull listeners in and never let them go.... </p> <p>Secret Identities. </p> <p>Extraordinary Powers. </p> <p>She wants vengeance. </p> <p>He wants justice. </p> <p>The Renegades are a syndicate of prodigies - humans with extraordinary abilities - who emerged from the ruins of a crumbled society and established peace and order where chaos reigned. As champions of justice, they remain a symbol of hope and courage to everyone...except the villains they once overthrew. </p> <p>Nova has a reason to hate the Renegades, and she is on a mission for vengeance. As she gets closer to her target, she meets Adrian, a Renegade boy who believes in justice - and in Nova. But Nova's allegiance is to a villain who has the power to end them both. </p> <p><i>Renegades</i> is the next hit YA audiobook listeners have been waiting for! </p>"; 
